import React from 'react';
import './footer.css';
import logo from './logo.jpeg';

const Footer = () => {
    return(
        <div className="bottom">
            <img src={logo} alt=""/>
            <p>SCOPE all rights reserved 2019</p>
        </div>
    )
}


export default Footer;
